import React from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, ImageBackground } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import GymScreen from './Gym/GymScreen';
import SelectDateScreen from './Gym/SelectDateScreen';
import MainScreenComponent from './MainScreenComponent';
import Lostmain from './Lost/Lostmain';
import { widthPercentageToDP as wp, heightPercentageToDP as hp } from 'react-native-responsive-screen';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const MainScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
     
      <View style={styles.headerContainer}>
        <View style = {styles.imageContainer}>
          <ImageBackground
            source={require('./../assets/GWNU-LOGO.png')} // 이미지를 로컬 'assets' 폴더에서 불러옴
            style={styles.imageStyle}
            resizeMode="cover"
          >
          </ImageBackground>
        </View>

        <View style = {styles.textContainer}>
          <Text style={styles.textStyle}>국립 강릉원주대학교</Text>
          <Text style={styles.subHeader}>GANGNEUNG-WONJU NATIONAL UNIVERSITY</Text>
        </View>
        <View style={styles.spacer}/>
      </View>

      <View style={styles.bodyContainer}>
        <View style = {styles.bodyTopContainer}>
          <Text style={styles.bodyTopContainer}>
            TEXT
          </Text>
        </View>

        <View style = {styles.bodyMiddleContainer}>
          <View style={styles.loginFormContainer}>
            <TextInput
              style={styles.input}
              placeholder="아이디"
            />
            <TextInput
              style={styles.input}
              placeholder="비밀번호"
              secureTextEntry={true}
            />
            <TouchableOpacity
              style={styles.loginButton}
              onPress={() => navigation.navigate('MainScreenComponent')}
            >
              <Text style={styles.loginButtonText}>로그인</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.signupButton}
            >
            <Text style={styles.signupButtonText}>회원가입</Text>
            </TouchableOpacity>
          </View>
        </View>

        <View style = {styles.bodyBottomContainer}/>
      </View> 
        
      
      
      
      
      <View style={styles.bottomImageContainer}>
        <ImageBackground
            source={require('./../assets/teamLogo.png')} // 이미지를 로컬 'assets' 폴더에서 불러옴
            style={styles.bottomImageStyle}
            
        >
        </ImageBackground>
      </View>
    </View>
    
  );
};

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Main">
        <Stack.Screen
          name="Main"
          component={MainScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="MainScreenComponent"
          component={MainScreenComponent}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="GymScreen"
          component={GymScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="SelectDateScreen"
          component={SelectDateScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen 
          name="Lostmain" 
          component={Lostmain} 
          options={{ headerShown: false }} 
        />

      </Stack.Navigator>
    </NavigationContainer>

    
  );

};

const styles = StyleSheet.create({
  container: {
    
    alignItems: 'center',
    justifyContent: 'center',
  },

  //헤더 컨테이너 이미지, 텍스트
  headerContainer: {
    flex: 1,
    backgroundColor: 'rgb(0, 150, 200)',
    width: '100%',
    height: hp('15%'),
    position: 'absolute',
    flexDirection: 'row',
    top: 0,
    alignItems: 'center',
    justifyContent: 'center',
  },
  
  imageContainer: {
    width: wp('20%'),
    left: wp('4%'),

  },
  imageStyle: {
    top: hp('2%'),
    width: wp('15%'),
    height:hp('7%'),
  },


 textContainer: {
    width: wp('60%'),
    alignItems: 'center',
    
 },

  textStyle: {
    fontSize: hp('3%'), 
    top: hp('2%'), 
    fontWeight: 'bold',
    alignItems: 'center',
    
  },
  spacer: {
    width: wp('20%'),
  },


  subHeader: {
    fontSize: hp('1%'), 
    top: hp('3%'), 
    fontWeight: 'bold',
    color: 'white',
  },

//여기부터 로그인 컨테이너

bodyContainer: {
  

},
  
  loginFormContainer: {
    marginTop: 100,
    alignItems: 'center',
  },
  bodyTopContainer: {
    backgroundColor: 'red',
    height: '30%',

  },

  bodyMiddleContainer: {
    

  },
  input: {
    width: '80%',
    backgroundColor: 'white',
    paddingVertical: 15,
    paddingHorizontal: 160,
    marginBottom: 10,
    borderRadius: 5,
    borderWidth: 1,
    borderColor: 'gray',
  },
  loginButton: {
    backgroundColor: 'blue',
    width: '80%',
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 5,
    alignItems: 'center',
    justifyContent: 'center',
    borderWidth: 1,
    borderColor: 'gray',
  },
  loginButtonText: {
    color: 'white',
    fontSize: 16,
    fontWeight: 'bold',
  },
  signupButton: {
    marginTop: 10,
  },
  signupButtonText: {
    color: 'blue',
    fontSize: 16,
    fontWeight: 'bold',
  },

  //팀 로고 이미지 컨테이너
  bottomImageContainer: {
    
    position: 'absolute',
    bottom: 0,
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
    height: hp('15%'),
  },

  bottomImageStyle: {
    width: wp('50%'),
    height: hp('14%'),
  },

});

export default App;
